import request from '@/utils/request';
export function getList(params) {
  return request({
    url: '/user/list',
    method: 'get',
    params: params
  });
}
export function saveUser(params) {
  return request({
    url: '/user',
    method: 'post',
    params: params
  });
}
export function remove(userId) {
  return request({
    url: '/user',
    method: 'delete',
    params: {
      userId: userId
    }
  });
}
export function setRole(params) {
  return request({
    url: '/user/setRole',
    method: 'get',
    params: params
  });
}
